import './Expenses.css'
import ExpenseItem from './ExpenseItem';

function Expenses(props) {
    let array = []
    for (i = 0; i < props.num; i += 1) {
        array.push(<ExpenseItem date={props[i].date} />);
    }
    return (
        <ExpenseItem />
    )
}

export default Expenses;
